import logo from "../image/logo.png";
import "./NavBar.css";
import React from "react";

function NavBar() {
    return (
        <>
            <nav className="md:z-50 fixed top-0 left-0 right-0 md:mx-auto h-24 mb-12 shadow-md
                shadow-[rgba(0,0,0,0.35)_0px_5px_15px,rgba(163,230,53,0.5)_5px_10px_15px]"
                style={{ border: '4px solid #b6d023', backgroundColor: '#fff' }}>
                <div className="flex items-center justify-between h-full px-10 md:px-20">
                    {/* Logo */}
                    <a href="/">
                        <img className="h-12 md:h-32 mx-auto md:mx-0" src={logo} alt="Logo" />
                    </a>

                    {/* Hamburger menu for mobile */}
                    <div className="md:hidden flex items-center">
                        <button className="text-black focus:outline-none">
                            <span className="block w-6 h-0.5 bg-black mb-2"></span>
                            <span className="block w-6 h-0.5 bg-black mb-2"></span>
                            <span className="block w-6 h-0.5 bg-black"></span>
                        </button>
                    </div>

                    {/* Navigation links */}
                    <div className="hidden md:flex items-center justify-center space-x-8">
                        {/* Home Button */}
                        <a href="/" className="rounded-full bg-transparent hover:text-blue-400 active:text-blue-400 hover:-translate-y-1 transition-transform duration-300">
                            Accueil
                        </a>

                        {/* About Us Button */}
                        <a href="/aboutus" className="rounded-full bg-transparent hover:text-blue-400 active:text-blue-400 hover:-translate-y-1 transition-transform duration-300">
                            A propos
                        </a>

                        {/* Services Button */}
                        <a href="/services" className="rounded-full bg-transparent hover:text-blue-400 active:text-blue-400 hover:-translate-y-1 transition-transform duration-300">
                            Nos Services
                        </a>

                        {/* Partners Button */}
                        <a href="/partners" className="rounded-full bg-transparent hover:text-blue-400 active:text-blue-400 hover:-translate-y-1 transition-transform duration-300">
                            Nos Références
                        </a>

                        {/* Contact Button */}
                        <a href="/contactus" className="rounded-full bg-transparent hover:text-blue-400 active:text-blue-400 hover:-translate-y-1 transition-transform duration-300">
                            Contactez-nous
                        </a>

                        {/* News Button */}
                        <a href="/news" className="rounded-full bg-transparent hover:text-blue-400 active:text-blue-400 hover:-translate-y-1 transition-transform duration-300">
                            Actualités
                        </a>

                        {/* Call Button */}
                        <a
                            className="w-full h-10 lg:w-60 text-white flex items-center justify-center rounded-full"
                            type="submit"
                            href="tel:+229 62 31 5172"
                            style={{ backgroundColor: '#b6d023' }}>
                            +229 62 31 5172
                        </a>
                    </div>
                </div>
            </nav>

            {/* Add spacing for the content below the navbar */}
            <div className="mt-24 md:mt-0">
                {/* Content below navbar */}
            </div>
        </>
    );
}

export default NavBar;
